import { blue } from "@mui/material/colors";
import { fontSize } from "@mui/system";
import { useState, useEffect } from "react";
import Navbar from "../templates/Navbar";
import React, { Component } from 'react';
import Buyer_Navbar from "../templates/Buyer_Navbar";
import axios from "axios";


export class Buyer_Home extends Component {
  constructor(props){
    super(props);
    this.state={
      email:"",
      data:{}
    };
  }

  componentDidMount(){
    const newBuyer={
      email:localStorage.getItem("email"),  
    }
    this.setState({email:newBuyer.email});
    axios
      .post("http://localhost:4000/buyer",newBuyer).then(
        response => {
          this.setState({data:response.data});
        })
        .catch(function(error){
          console.log(error);
        }
      )
  }

  render() {
    return <div>
      <div><Buyer_Navbar></Buyer_Navbar></div>
        <h1> <center> Welcome </center> </h1>
    </div>
  }
}

export default Buyer_Home;
